import Titulo from './components/Titulo'; // Asegúrate de que la ruta a Titulo.jsx sea correcta

const App = () => {
  return (
    <BrowserRouter>
      <div>
        <Titulo /> {/* El componente Titulo debe estar dentro del BrowserRouter */}

        <Routes>
          <Route path="/javaide" element={<JavaIDE />} />
          <Route path="/" element={<Inicio />} />
        </Routes>
      </div>
    </BrowserRouter>
  );
};

export default App;
